import React from 'react';
import ReactDOM from 'react-dom';
import PrismicApp from './PrismicApp';

ReactDOM.render(
  <PrismicApp />,
  document.getElementById('root'),
);

const PORT = process.env.PORT || 5000;
app.listen(PORT);
